import React from "react";
import Header from "../../molecules/Header/Header";
import "./App.css";
import Sidebar from "../../molecules/Sidebar/Sidebar";
import Task from "../Task/Task";

const App: React.FC = () => {
  return (
    <div className="App">
      <Header />
      <Sidebar />
      <Task />
    </div>
  );
};

export default App;
